<body>
  <style>
    @charset "UTF-8";

    /*! normalize.css v8.0.1 | MIT License | github.com/necolas/normalize.css */
    html {
      line-height: 1.15;
      -webkit-text-size-adjust: 100%
    }

    body {
      margin: 0
    }

    main {
      display: block
    }

    h1 {
      font-size: 2em;
      margin: .67em 0
    }

    hr {
      box-sizing: content-box;
      height: 0;
      overflow: visible
    }

    pre {
      font-family: monospace, monospace;
      font-size: 1em
    }

    a {
      background-color: transparent
    }

    abbr[title] {
      border-bottom: none;
      text-decoration: underline dotted
    }

    b,
    strong {
      font-weight: bolder
    }

    code,
    kbd,
    samp {
      font-family: monospace, monospace;
      font-size: 1em
    }

    small {
      font-size: 80%
    }

    sub,
    sup {
      font-size: 75%;
      line-height: 0;
      position: relative;
      vertical-align: baseline
    }

    sub {
      bottom: -.25em
    }

    sup {
      top: -.5em
    }

    img {
      border-style: none
    }

    button,
    input,
    optgroup,
    select,
    textarea {
      font-family: inherit;
      font-size: 100%;
      line-height: 1.15;
      margin: 0
    }

    button,
    select {
      text-transform: none
    }

    button,
    [type=button],
    [type=reset],
    [type=submit] {
      -webkit-appearance: button
    }

    button::-moz-focus-inner,
    [type=button]::-moz-focus-inner,
    [type=reset]::-moz-focus-inner,
    [type=submit]::-moz-focus-inner {
      border-style: none;
      padding: 0
    }

    button:-moz-focusring,
    [type=button]:-moz-focusring,
    [type=reset]:-moz-focusring,
    [type=submit]:-moz-focusring {
      outline: 1px dotted ButtonText
    }

    fieldset {
      padding: .35em .75em .625em
    }

    legend {
      box-sizing: border-box;
      color: inherit;
      display: table;
      max-width: 100%;
      padding: 0;
      white-space: normal
    }

    progress {
      vertical-align: baseline
    }

    textarea {
      overflow: auto
    }

    [type=checkbox],
    [type=radio] {
      box-sizing: border-box;
      padding: 0
    }

    [type=number]::-webkit-inner-spin-button,
    [type=number]::-webkit-outer-spin-button {
      height: auto
    }

    [type=search] {
      -webkit-appearance: textfield;
      outline-offset: -2px
    }

    [type=search]::-webkit-search-decoration {
      -webkit-appearance: none
    }

    ::-webkit-file-upload-button {
      -webkit-appearance: button;
      font: inherit
    }

    details {
      display: block
    }

    summary {
      display: list-item
    }

    template {
      display: none
    }

    [hidden] {
      display: none
    }

    body {
      width: 100dvw;
      height: 100dvh;
      background-color: #151515;
      overflow: hidden
    }

    .container {
      width: 100dvw;
      height: 100dvh;
      position: relative;
      overflow: hidden;
      display: flex;
      justify-content: space-between
    }

    .button {
      cursor: pointer;
      animation: btnAnim 1s ease-in-out infinite alternate;
      transition: opacity .3s
    }

    .button.hide {
      opacity: 0;
      pointer-events: none
    }

    .part {
      width: 40%;
      display: flex;
      flex-direction: column;
      align-items: center;
      justify-content: center;
      gap: 3dvh;
      padding: 5px
    }

    .part svg {
      width: 100%;
      max-height: 100%
    }

    .spinner {
      position: relative;
      width: 100%
    }

    .cup {
      position: absolute;
      z-index: -1;
      width: 7dvw
    }

    .cup1 {
      left: 0dvw;
      top: 0dvh;
      width: auto;
      max-width: 10dvw;
      max-height: 15dvh;
      animation: livitation1 3s ease-in-out infinite alternate
    }

    .cup2 {
      right: 0dvw;
      bottom: 0dvh;
      animation: livitation2 4s ease-in-out infinite alternate
    }

    .cup3 {
      left: 0dvw;
      bottom: -3dvh;
      animation: livitation3 2s ease-in-out infinite alternate
    }

    .cup4 {
      left: -10dvw;
      top: 50dvh;
      animation: livitation4 3s ease-in-out infinite alternate
    }

    .cup5 {
      right: 0dvw;
      top: -2dvh;
      animation: livitation5 5s ease-in-out infinite alternate
    }

    @keyframes livitation1 {
      to {
        transform: translate(25%, 25%)
      }
    }

    @keyframes livitation2 {
      to {
        transform: translate(-25%, -65%)
      }
    }

    @keyframes livitation3 {
      to {
        transform: translate(25%, 35%)
      }
    }

    @keyframes livitation4 {
      to {
        transform: translate(22%, -45%)
      }
    }

    @keyframes livitation5 {
      to {
        transform: translate(-25%, 65%)
      }
    }

    #spinner {
      transform-origin: center
    }

    .spin {
      animation: spinWheel 6s ease-in-out forwards
    }

    @keyframes spinWheel {
      0% {
        transform: rotate(0)
      }

      70% {
        transform: rotate(2673deg)
      }

      to {
        transform: rotate(2656deg)
      }
    }

    .winn {
      position: absolute;
      z-index: 55;
      width: 100dvw;
      height: 100dvh;
      opacity: 0;
      pointer-events: none;
      transition: opacity .3s
    }

    .winn__box {
      width: 100dvw;
      height: 100dvh;
      top: 0;
      left: 0;
      position: relative;
      background-color: #000000a6
    }

    .winnItem {
      width: 30dvw;
      position: absolute;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%) scale(.2);
      transition: transform .3s, opacity .3s
    }

    .shine {
      width: 50dvw;
      transform-origin: center;
      animation: rotate 20s linear infinite alternate
    }

    .winn.active {
      opacity: 1
    }

    .winn.active .winnItem {
      transform: translate(-50%, -50%) scale(1)
    }

    .winn.active .winnItem.hide {
      transform: translate(-50%, -50%) scale(0);
      opacity: 0
    }

    @keyframes rotate {
      to {
        transform: translate(-50%, -50%) scale(1) rotate(720deg)
      }
    }

    #lastBtn {
      max-width: 80dvw;
      max-height: 80dvh;
      position: absolute;
      left: 50%;
      top: 50%;
      transform: translate(-50%, -50%) scale(0);
      transition: transform .3s;
      cursor: pointer;
      pointer-events: none
    }

    #lastBtn.active {
      transform: translate(-50%, -50%) scale(1);
      animation: lastAnim 1s ease-in-out infinite alternate;
      pointer-events: all
    }

    @keyframes lastAnim {
      to {
        transform: translate(-50%, -50%) scale(.9)
      }
    }

    @keyframes btnAnim {
      to {
        transform: scale(.9)
      }
    }

    @media (max-aspect-ratio: 1/1) {
      .container {
        flex-direction: column;
        justify-content: space-around
      }

      .part {
        width: 100%;
        align-items: center;
        padding: 0
      }

      #btn {
        position: absolute;
        bottom: 10dvh;
        display: none
      }

      .winnItem {
        width: 65dvw
      }

      .shine {
        width: 100dvw
      }

      .cup1 {
        left: 5dvw
      }

      .cup2 {
        right: 5dvw;
        width: auto;
        height: 3dvh
      }

      .cup3 {
        left: 4dvw;
        width: auto;
        height: 10dvh
      }

      .cup4 {
        left: 36dvw;
        top: -3dvh;
        width: auto;
        height: 5dvh
      }

      .cup5 {
        right: 5dvw;
        top: 0;
        width: auto;
        height: 3dvh
      }

      .title svg {
        max-height: 25dvh
      }

      .spinner {
        display: flex;
        justify-content: center
      }

      .spinner svg {
        max-height: 50dvh
      }

      .btn {
        display: flex;
        justify-content: center
      }

      #btnSecond {
        margin-bottom: 60px
      }

      #btnSecond svg {
        max-width: 75dvw;
        height: auto
      }
    }

    .text {
      position: absolute;
      width: 100dvw;
      bottom: 1dvh;
      color: #ccc;
      display: flex;
      justify-content: center;
      text-align: center;
      font-size: 12px
    }
  </style>
